const blacklisted = member.data(`${server.id}blacklist`);
if (blacklisted === true) {
    msg.channel.send(`Sorry ${member.displayName}, You're currently blacklisted from using the bot in this server!`);
} else {
    Actions.callNextAction(cache);
}

const moment = this.getWrexMods()
    .require('moment');

const prefix = (server && server.tag) || this.getDBM()
    .Files.data.settings.tag;
const text = msg.content.slice(prefix.length)
    .trim()
    .split(/ +/g);
text.shift();
let infoMem;

if (!text || text.length < 1) {
    infoMem = msg.member;
} else {
    infoMem = msg.mentions.members.first() || server.members.find(m => m.id === `${text.join(' ')}`) || server.members.find(m => m.displayName.toUpperCase() === `${text.join(' ').toUpperCase()}`) || server.members.find(m => m.user.username.toUpperCase() === `${text.join(' ').toUpperCase()}`) || server.members.find(m => m.user.username.toLowerCase()
        .includes(`${text.join(' ').toLowerCase()}`));
}

(async () => {
    if (!infoMem) {
        const f_id = text.join(' ').replace('<@', '').replace('>', '');
        try {
            infoMem = await client.fetchUser(f_id);
        } catch (err) {
            infoMem = msg.member;
        }
    }

let commands = this.getVariable(3, 'commands', cache);
commands = commands += 1;
this.storeValue(commands, 3, 'commands', cache);
this.getDBM().Files.saveGlobalVariable('commands', commands);

    if (server.member(infoMem)) {
        const joinPosition = await getJoinPosition(infoMem.id, msg.guild);
        const ts = moment(infoMem.user.createdAt);
        const ts2 = moment(infoMem.joinedAt);
        const ca = ts.format("MMM Do, YYYY");
        const ja = ts2.format("MMM Do, YYYY");
        const roles = infoMem.roles.sort((a, b) => b.position - a.position);
        let roles1 = roles.filter(r => r.id !== msg.guild.id)
            .array()
            .join(', ');
        if (roles1 === undefined || roles1.length == 0) {
            roles1 = "No Roles";
        }
        const embed = new DiscordJS.RichEmbed()
            .setTitle(`${infoMem.user.username}'s Info`)
            .setColor('RANDOM')
            .setThumbnail(infoMem.user.displayAvatarURL)
            .setAuthor(msg.member.displayName, msg.author.displayAvatarURL)
            .addField('**User Tag**', infoMem.user.tag, true)
            .addField('**Nickname**', infoMem.displayName, true)
            .addField('**User ID**', infoMem.id, true)
            .addField('**Status**', infoMem.user.presence.status, true)
            .addField('**Joined Server**', ja, true)
            .addField('**Account Created**', ca, true)
            .addField('**Join Position**', `${Number(joinPosition)}`, true)
            .addField('**Roles**', roles1, false);
        if (me.permissions.has('MANAGE_MESSAGES')) msg.delete();
        msg.channel.send(embed);
    } else {
        //not guild member
        const ts = moment(infoMem.createdAt);
        const ca = ts.format("MMM Do, YYYY");
        const embed = new DiscordJS.RichEmbed()
            .setTitle(`${infoMem.username}'s Info`)
            .setColor("RANDOM")
            .setThumbnail(infoMem.displayAvatarURL)
            .setAuthor(msg.member.displayName, msg.author.displayAvatarURL)
            .addField('**User Tag**', infoMem.tag)
            .addField('**User ID**', infoMem.id)
            .addField('**Is Bot?**', infoMem.bot)
            .addField('**Account Created**', ca);
        if (me.permissions.has('MANAGE_MESSAGES')) msg.delete();
        msg.channel.send(embed);
    }
    async function getJoinPosition(id, guild) {
        if (!guild.member(id)) return;

        await guild.fetchMembers();
        const array = guild.members.array();
        array.sort((a, b) => a.joinedAt - b.joinedAt);

        const result = array.map((m, i) => ({
                index: i,
                id: m.user.id
            }))
            .find((m) => m.id === id);
        return (result && result.index) || null;
    }
})();

